'1. Introduction
Cross-site scripting (XSS) attacks target vulnerable web applications, injecting client-side scripts into web pages viewed by other users. A common way to target someone is to send a link to a webpage that contains
the XSS attack so that the target will open the link and inject the script. They bypass the Same Origin Policy (SOP) and may bypass access control systems.

2. Targets and Effects
The injection works client-side and so the main target are users, be that directly by sending a malicious link (like in a scam mail) or by storing it in a vulnerable webpage that is going to be loaded by another user.
XSS attacks can lead to stolen credentials, disclosure of the user''s session cookies installation of Trojans or alter the content of a web page that can lead to disastrous consequences.

3. Example
XSS attacks can be used to steal crediants by tricking users into submitting their data in page they think is the real one when in reality they are writing in a malicious page loaded by the script inside the URL.
An XSS attack on a pharmaceutical site can alter the dosage shown to the user, possibly causing an overdose; stealing a session''s cookies lets the attacker hijack the user''s session and take over the account. These
are but a few of the possible attacks.

4. Countermeasures
Sanitization of the code is the main way to defend a web application from this kind of attacks. Secure pages should escape all characters that can be used for such an attack (\
'', ", >, and so on) and write the code
keeping in mind the possible attacks that can be used: a sanitized page written poorly can still be attacked in certain scenarios. There are automatic functions that can handle this, like escapeshellcmd(),
htmlspecialchars() and escapeshellarg(). There are other ways to mitigate this attacks, like using cookies to handle authentication or by disabling scripts entirely but they are not perfect solutions or can reduce
the functionality and responsiveness of the web page.

