('05732286-9fa5-45d4-bef3-13ae0d481afa', 2, 'SQL Injection', 
'It seems that Philip Rich has moved away to attend a meeting with the shareholders of Black Millstone. He was able to hide his tracks quite well, but not well enough. Even private flights are logged in the airports and so what I need is 
the list of planes of the nearby airport that departed last night. He was last seen yesterday afternoon leaving his manor and this morning the house was already empty, so the timeframe is limited to that. Without help from outside, I''ll need 
to fetch myself the list of flights: nothing to fancy, and knowing the old man he registered the plane using the same credentials that he used for Black Millstone. [more info about the actual attack are needed]
Once I get that, than I''ll have to hurry to my jet. I can''t miss an event like that: not only all the money movers behind Black Millstone''s dirty operations will be there, but maybe I''ll be so lucky that even the real mastermind behind this might show up...', 
'1. Introduction
SQL injection is a type of attack aimed to inject malicious code into a data-driven application like a database. It exploits vulnerabilities in the code that allow the attacker to write statements that override or skip parts of the real query.
It usually relies on special characters that are used in the syntax of the query that allow the attacker to manipulate structure of the query, like using a ''-- in the username field comments out the part of the query about the password.

2. Targets and Effects
Websites that rely on a database are a common target, but any application relying on a database can be affected. If successul, depending on the severity of the vulnerability, the attacker can steal credentials, modify or destroy data,
get unauthorized access to elements in the database (like becoming an admin).

3. Example
An SQL injection can bypass a login (like using only the username and skipping the password requirement), retrieve data usually not accessible with an injected query, drop tables, delete the database, get admin privileges and many more.
This can be used to steal private/sensible data stored on a database to sell it to third parties, steal credentials that might be shared accross platforms if the users use the same passwords across multiple applications, or even delete the entire
database after obtaining a copy of it (with another SQL injection or exploiting other vulnerabilities) to then request a ransom.

4. Countermeasures
The keyword here is Sanitization: escaping special characters like '', " or ; that are used in the syntax of the query prevents many injections. Modern languages usually provide functions that automatically sanitize the query before it is sent to the
database, so reading the documentation while writing a system that interacts with one (like the backend of a web application) is crucial. Badly written code can be exploited even with a sanitized input, so the programmer should write the queries keeping
in mind the possible attacks that could be tried, and following standard procedures about writing good quality code.

